Attributes[rB] = {Orderless}
 
rB[1] = Function[{q, m0, m1}, rA[0][m0]/(2*Sqr[q]) - rA[0][m1]/(2*Sqr[q]) - 
      ((m0^2 - m1^2 + Sqr[q])*rB[0][q, m0, m1])/(2*Sqr[q])]
 
rB[0, 0] = Function[{q, m0, m1}, ((m0^2 - m1^2 + Sqr[q])*rA[0][m0])/
       (4*(-1 + Dim)*Sqr[q]) + ((-m0^2 + m1^2 + Sqr[q])*rA[0][m1])/
       (4*(-1 + Dim)*Sqr[q]) - (((m0^2 - m1^2)^2 - 2*(m0^2 + m1^2)*Sqr[q] + 
         Sqr[q]^2)*rB[0][q, m0, m1])/(4*(-1 + Dim)*Sqr[q])]
 
rB[1, 1] = Function[{q, m0, m1}, -(Dim*(m0^2 - m1^2 + Sqr[q])*rA[0][m0])/
       (4*(-1 + Dim)*Sqr[q]^2) + ((Dim*(m0^2 - m1^2) + (-4 + 3*Dim)*Sqr[q])*
        rA[0][m1])/(4*(-1 + Dim)*Sqr[q]^2) + 
      ((Dim*(m0^2 - m1^2)^2 + 2*((-2 + Dim)*m0^2 - Dim*m1^2)*Sqr[q] + 
         Dim*Sqr[q]^2)*rB[0][q, m0, m1])/(4*(-1 + Dim)*Sqr[q]^2)]
 
Sqr[(HEPMath`Tensors`Private`n_)?NumericQ] := HEPMath`Tensors`Private`n^2
 
Sqr /: Sqr::usage = "Sqr[t] denotes the full contraction of the tensors t \
with\nitself. It is equivalent to SDot[t,t]."
 
Dim /: Dim::usage = "Dim is the default dimension of Lorentz vectors"
 
Attributes[rC] = {Orderless}
 
rC[1] = Function[{q1$, q2$, m0$, m1$, m2$}, 
     (SDot[q1$, q2$]*rB[0][q1$, m0$, m1$])/(2*SDot[q1$, q2$]^2 - 
