       (2*SDot[q1$, q2$]^2 - 2*Sqr[q1$]*Sqr[q2$]) - 
      ((SDot[q1$, q2$] + Sqr[q2$])*rB[0][q1$ + q2$, m0$, m2$])/
       (2*SDot[q1$, q2$]^2 - 2*Sqr[q1$]*Sqr[q2$]) + 
