         (-1 + Dim)*SDot[q1$, q2$]*(m1$^2 - m2$^2 + Sqr[q2$]))*
        rB[0][q2$, m1$, m2$])/(4*(-2 + Dim)*
        (SDot[q1$, q2$]^2 - Sqr[q1$]*Sqr[q2$])^2) + 
