             (-2 + Dim)*Sqr[q1$] + (-4 + 3*Dim)*Sqr[q1$ + q2$])) - 
         Sqr[q2$]*((-2 + Dim)*Sqr[q1$]^2*Sqr[q2$] + (-1 + Dim)*
